import React from "react";
import { useAuth0 } from "@auth0/auth0-react";

const LogoutButton = () => {
  const { logout } = useAuth0();
  return (
    <button
      onClick={() => logout()}
      id="qsLoginBtn"
      variant="primary"
      className="btn-margin"
    >
      Advocates
    </button>
  );
};

export default LogoutButton;
